&quot;Fifteen&quot; is the title of a song written and recorded by American country artist Taylor Swift. The song was released on September 1, 2009, as the fourth US single as well as the fourth UK single from her 2008 album Fearless.

Swift performed this song with Miley Cyrus at the 51st Grammy Awards.

The official music video premeired on CMT at CMT.com on October 9, 2009. The music video (directed by Roman White) shows Taylor walking through flowers, walking through her school and singing about her freshman year. She sings about her best friend, &quot;A redhead named Abigail,&quot;, and then the video goes to Abigail in a car with her boyfriend, and then Taylor sings about how Abigail got her heart broken by her boyfriend. &quot;And Abigail gave everything she had to a boy, who changed his mind.&quot;At the end of the video, it shows Taylor at a high school telling a freshman girl to just take a deep breath and walk through the doors, and the girl nods in acknowledgement. The last scene shows the plot of the song on &quot;going back and telling yourself what you know now&quot;.

Matt Bjorke of Roughstock gave the song a mostly favorable review. He said that it will &quot;ultimately hit home for kids who live of the moment, by the moment because it serves as a cautionary tale to remind kids that life does indeed go on, even when it seems like it possibly can't.&quot; While Leann Ward of Country Universe, gave it a B+ rating, and describes the song as &quot;much more relevant than the parents' advice and other well meaning adults who are forced to speak from somewhat distant memories.&quot; Stephen M. Deusner of The 9513 gave it a thumbs-up, saying that its message would &quot;resonate&quot; with its target audience of teenagers, adding, &quot;What makes 'Fifteen' such an effective single[ÃƒÂ¢Ã¢â€šÂ¬Ã‚Â¦] is that it proves Swift is the primary agent in her music[.]&quot;

